import SearchBar from "../SearchBar/SearchBar"
import styles from "../nav/Nav.module.css"

export default function Nav ({onSearch}){
    return(
        <nav >
            <SearchBar onSearch={onSearch}></SearchBar>
            <button className={styles.aleatorio} oncl ></button>
        </nav>
    )
}
